  	// let sTimeId = e.target.id
  	// let eTimeId = e.target.id
    console.log(startDateTime, this.props)

  }


  render(){
      return (
        <div  >
            <TextField
				id="start-date"
				variant='outlined'
				label="Start"
				type="datetime-local"
				onChange={ e =>{this.getDateTimeValue(e)}}
				InputLabelProps={{ shrink: true,}}
             />
             <TextField
				id="end-date"
				variant='outlined'
				label="End"
				type="datetime-local"
				onChange={ e =>{this.getDateTimeValue(e)}}
				InputLabelProps={{ shrink: true,}}
             />

       </div>
      );
  }

}



export default DateTimePicker;
